import logo from './gaucho.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World!
        </p>
        <p>
          UCSB Rideshare Project - Robert Gee
        </p>
      </header>
    </div>
  );
}

export default App;
